    super(props)
    this.state = {
      uname: "",
      psw: "",
      validationMsg: {},
      namerror:"",
      passerror:""
    }

  this.onUserNameChange = this.onUserNameChange.bind(this);
  this.onPasswordeChange = this.onPasswordeChange.bind(this);
  this.login = this.login.bind(this);
  }

componentWillMount() {

}
