  // const { username, password } = loginForm;


  // Component code
  return (
    <div className="loginPage">
      <form id="loginform" onSubmit={this.login}>
      <img src="https://icons.iconarchive.com/icons/papirus-team/papirus-status/512/avatar-default-icon.png" style={{"width":"80px", "height":"70px", "margin-top":"20px"}} /><br/>
      <h1> Login Here</h1>
      <input
        type="text"
        name="username"
        value={this.uname}
        placeholder="Username"
        onChange={this.onUserNameChange}
      /><span id="nameerror">{this.state.namerror}</span>
      <br/>


       <input
        type="password"
        name="password"
        placeholder="Enter your password"
        value={this.psw}
        onChange={this.onPasswordeChange}
       />
      <span id="passerror">{this.state.passerror}</span>
      <br/>
      <div id="loginerror"><span >{loginFailErrorMessage}</span></div>
       <button 
       type="submit">
        Submit
      </button> <br />
      <a href = "#" onClick={handleClick}>Don't Have an Account?</a>

    </form>

   </div>


  );
}
}
const mapStateToProps = (state) => {
  return {
    authenticated: state.login.authenticated,
    loginFailError: state.login.error,
    errorMessage : state.login.errorMessage,
    isPasswordExpired : state.login.isPasswordExpired
  }
}



export default compose(
  connect(mapStateToProps)
)(LoginPage);
